webpackJsonp([0xb9ff2d98899],{357:function(e,t){e.exports={pathContext:{posts:[{html:'<h1>Kinectron</h1>\n<h2>A Realtime Peer Server for Kinect 2</h2>\n<blockquote>\n<p><a href="http://lisajamhoury.com/">Lisa Jamhoury</a>, ITP 2017<br>\n<a href="https://github.com/vanevery">Shawn Van Every</a>, ITP  </p>\n<blockquote>\n<p>Additional collaborators: <a href="http://anothersideproject.co/">Stephanie Koltun</a>, <a href="www.orfleisher.com">Or Fleisher</a> and <a href="http://montoyamoraga.io/">Aar√≥n Montoya-Moraga</a>  </p>\n</blockquote>\n</blockquote>\n<blockquote>\n<p>2017</p>\n</blockquote>\n<p>Kinectron is a node-based library that broadcasts Kinect2 data over a peer connection. It builds on the Node Kinect2 and PeerJS libraries.<br>\nKinectron sends Kinect depth, color and skeletal data over a peer network. It can be used in a number of ways.<br>\nKinectron has two components--an electron application to broadcast Kinect2 data over a peer connection, and a client-side API to request and receive Kinect2 data over a peer connection.  </p>\n<p><a class="btn btn-outline-primary" href="https://kinectron.github.io/" role="button">Project Page</a>   <a class="btn btn-outline-primary" href="https://github.com/kinectron/kinectron" role="button">GitHub Repository</a>  </p>',id:"/home/travis/build/ITP-xStory/website/src/pages/projects/kinectron.md absPath of file >>> MarkdownRemark",frontmatter:{date:"2018-05-23T12:34:00+00:00",thumbnail:"https://kinectron.github.io/img/depth.gif",path:"/kinectron",title:"Kinectron",excerpt:"Kinectron is a node-based library that broadcasts Kinect2 data over a peer connection. It builds on the Node Kinect2 and PeerJS libraries.",tags:["Tool"]}},{html:'<h1>Skeletron</h1>\n<h2>Predicting human pose in 3D using any camera</h2>\n<blockquote>\n<p><a href="www.orfleisher.com">Or Fleisher</a>, ITP 2018<br>\n<a href="www.drorayalon.com">Dror Ayalon</a>, ITP 2018<br>\n2018</p>\n</blockquote>\n<iframe width="560" height="315" src="https://www.youtube.com/embed/l_owi316cE8" frameborder="0" allow="autoplay; encrypted-media" allowfullscreen></iframe>\n<p>Skeletron is a system that predicts joints and human skeleton position in 3d from real-time video taken by any (cheap) RGB camera, such as a webcam. The system sends the data about the position of the human body to Unity, a 3D game development engine, to allow engineers, artists, and creative technologists to use it to develop digital experiences.</p>\n<p>INGREDIENTS</p>\n<ul>\n<li>Machine Learning Model - <a href="http://gvv.mpi-inf.mpg.de/projects/VNect/">http://gvv.mpi-inf.mpg.de/projects/VNect/</a></li>\n<li>TensorFlow port - <a href="https://github.com/timctho/VNect-tensorflow">https://github.com/timctho/VNect-tensorflow</a></li>\n<li>Model prediction - Google TensorFlow</li>\n<li>Data representation in 3D - <a href="https://unity3d.com/">https://unity3d.com/</a></li>\n</ul>\n<h4>Press</h4>\n<blockquote>\n<p>"Programmers use TensorFlow AI to turn any webcam into Microsoft Kinect"<br>\n<a href="https://thenextweb.com/artificial-intelligence/2018/01/30/programmers-use-tensorflow-ai-to-turn-any-webcam-into-microsoft-kinect/">View article on thenextweb.com</a></p>\n</blockquote>\n<blockquote>\n<p>"Two AI developers have turned a simple webcam into a system that behaves just like a Microsoft Kinect using machine learning"<br>\n<a href="https://www.techradar.com/news/ai-developers-can-turn-any-webcam-into-a-kinect">View article on techradar.com</a></p>\n</blockquote>\n<br>\n<a class="btn btn-outline-primary" href="http://orfleisher.com/portfolio-item/skeletron/" role="button">Project Page</a>',id:"/home/travis/build/ITP-xStory/website/src/pages/projects/skeletron.md absPath of file >>> MarkdownRemark",frontmatter:{date:"2018-01-30T12:34:00+00:00",thumbnail:"https://imgur.com/download/Xb436pS",path:"/skeletron",title:"Skeletron",excerpt:"Skeletron is a system that predicts joints and human skeleton position in 3d from real-time video taken by any (cheap) RGB camera",tags:["Machine Learning","Tool","Immersive","3D"]}}],tagName:"Tool"}}}});
